            this.richTextBox3.TabIndex = 1;
            this.richTextBox3.Text = "在餐廳林立的上海中，小紅樓擁有與眾不同的歷史，這幢法國人建造的三層樓法式洋樓，曾是中國唱片公司的所在地，多年後的今日更成為中國的文化遺產之一。經過2002年的整修" +
    "後，小紅樓散發出更獨特的魅力，歷史的光輝讓她散發了獨特的風韻，而如今小紅樓成了上海高級的酒吧西餐廳，也就是La Villa Rouge。";
