            this.richTextBox7.TabIndex = 1;
            this.richTextBox7.Text = "凱文餐廳酒吧，是一間座落於上海長樂路上的30年代四層洋房。凱文擁有歐風花園，隔絕了喧囂，餐廳內就是安靜雅緻的環境，裝潢舒適溫馨。紅椅白桌的搭配，以小燈點綴著壁上的" +
    "每幅掛畫，窗邊半六小型凸出有一小圓桌，不僅可享用美食，還可愜意的享受窗外的上海景色。設有露天庭園，木椅及藤椅擺設有秩，庭園呈現閒逸的感受，適合到此喝下午茶沉澱心" +
    "情。";
