            this.richTextBox13.Text = "在餐廳林立的上海中，小紅樓擁有與眾不同的歷史，這幢法國人建造的三層樓法式洋樓，曾是中國唱片公司的所在地，多年後的今日更成為中國的文化遺產之一。經過2002年的整修" +
